import './FlexGrid.css'
import React from 'react'

const FlexGrid = ({ alignItems, paddingTop, padding, children }) => (
	<div className="flex-grid" style={{ alignItems, padding, paddingTop }}>
		{children}
	</div>
)

export default FlexGrid
